I am the original owner, put about 700 rounds through this gun.  Just don’t shoot all that much anymore.  This gun was not carried but stored in my safe.
P-226 Sig Sauer Enhanced Elite Model Features compared to the basic model P-226 are:
One piece reduced reach ergonomic grip with updated stippling pattern;
Beavertail frame with front strap checkering and accessory rail;
Slide features "Elite" engraving and front strap checkering;
SRT Short Reset Trigger System;
SIGLITE® Night Sights.
Includes a Sig Holster.
Serious buyer must be an Oklahoma resident, willing to show ID, over 21, eligible to possess a firearm and willing to sign a bill of sale. I would prefer to sell CC holder. No trades or shipping.  I will meet FTF in far South Tulsa only.  If this ad is still up the gun is available.  If you are seriously interested and have any questions please email them, please don't ask me call you.
